import React, { Component } from 'react'


export class Movies extends Component {
    constructor() {
        super();
        this.state = {
            message: ''
        }
    }

    render() {
        return (
            <div>
                <h1>{this.state.message}</h1>
            </div>
        )
    }
}

export default Movies
